import React from 'react'
import { IoAirplaneSharp } from 'react-icons/io5'
import { FlightInfo } from '../../models/FlightInfo'
import { parseISO, differenceInMinutes, formatDistanceToNow } from 'date-fns';
import { FlightData } from '../../models/FlightData';
import moment from 'moment-timezone';

type FlightInfoProps = {
    flightInfo: FlightInfo
    flight: FlightData
}

const InfoFlight: React.FC<FlightInfoProps> = ({ flightInfo, flight }) => {
    function getCurrentTimeInUTC(): string {
        const now = new Date();
        const utcDate = new Date(now.getTime() + now.getTimezoneOffset() * 60000);
        return utcDate.toISOString();
    }
    
    const calculateTimeDifference = (isoString: string) => {
        const endTime = parseISO(isoString);
        const now = parseISO(getCurrentTimeInUTC());
        console.log('now', now);
        
        const totalMinutes = differenceInMinutes(endTime, now);
        const hours = Math.floor(totalMinutes / 60);
        const minutes = totalMinutes % 60;
        return { hours, minutes };
    };

    const calculate2TimeDifference = (isoString1: string, isoString2: string) => {
        const endTime = parseISO(isoString1);
        const startTime = parseISO(isoString2);
        const totalMinutes = differenceInMinutes(endTime, startTime);
        const hours = Math.floor(totalMinutes / 60);
        const minutes = totalMinutes % 60;
        return { hours, minutes };
    };

    return (
        <div>
            {
                (typeof flightInfo.far !== 'number' || typeof flightInfo.dflownNumber !== 'number' || typeof flightInfo.dtoGoNumber !== 'number') ||
                    (!flightInfo.far || !flightInfo.dflownNumber || !flightInfo.dtoGoNumber)
                    ?
                    <div>
                        <div className='text-center text-red-600'>Can't show result</div>
                    </div>
                    :
                    <div>
                        <div className="max-w-6xl mx-auto p-4">
                            <div className="relative text-center">
                                <div className="absolute top-1/2 -translate-y-1/2 left-0 w-full h-1 bg-green-300"></div>
                                <div
                                    className="absolute top-1/2 -translate-y-1/2 left-0 h-1 bg-green-700"
                                    style={{ width: `${(flightInfo.dflownNumber / flightInfo.far) * 100}%` }}
                                ></div>
                                <div className="absolute top-1/2 left-0 transform -translate-y-1/2 w-3 h-3 bg-green-700 rounded-full"></div>
                                <div className="absolute top-1/2 right-0 transform -translate-y-1/2 w-3 h-3 bg-green-600 rounded-full"></div>
                                <div
                                    className="absolute top-1/2"
                                    style={{ left: `${(flightInfo.dflownNumber / flightInfo.far) * 100}%`, transform: 'translateX(-50%) translateY(-50%)' }}
                                >
                                    <IoAirplaneSharp className='size-6 text-green-700' />
                                </div>
                            </div>
                        </div>

                        <div className="flex justify-between mt-4">
                            <div className="text-left">
                                <div className="bg-blue-900 text-white text-center p-1 rounded h-8">
                                    {
                                        flight.flight_status === 'active' && (
                                            flight.departure?.actual ?
                                            `${calculateTimeDifference(flight.departure?.actual ?? '').hours}h ${calculateTimeDifference(flight.departure?.actual ?? '').minutes}m elapsed`
                                            : 
                                            `${calculateTimeDifference(flight.departure?.estimated ?? '').hours}h ${calculateTimeDifference(flight.departure?.estimated ?? '').minutes}m elapsed`
                                        )
                                    }
                                </div>
                                <div className='mt-2 text-sm mx-2'>{Math.round(flightInfo.dflownNumber)} mi flown</div>
                            </div>
                            <div className="text-center">
                                <div className='mt-2 text-sm mx-2'>
                                    {
                                        flight.flight_status === 'active' && (
                                            flight.arrival?.actual ?
                                            `${calculate2TimeDifference(flight.arrival?.actual ?? '', flight.departure?.actual ?? '').hours}h ${calculate2TimeDifference(flight.arrival?.actual ?? '', flight.departure?.actual ?? '').minutes}m total travel time`
                                            : 
                                            `${calculate2TimeDifference(flight.arrival?.estimated ?? '', flight.departure?.actual ?? '').hours}h ${calculate2TimeDifference(flight.arrival?.estimated ?? '', flight.departure?.actual ?? '').minutes}m total travel time`
                                        )
                                    }
                                </div>
                            </div>
                            <div className="text-right">
                                <div className="bg-blue-900 text-white text-center p-1 rounded h-8">
                                {
                                    flight.flight_status === 'active' && (
                                        flight.arrival?.actual ?
                                        `${calculateTimeDifference(flight.arrival?.actual ?? '').hours}h ${calculateTimeDifference(flight.arrival?.actual ?? '').minutes}m remaining`
                                        : 
                                        `${calculateTimeDifference(flight.arrival?.estimated ?? '').hours}h ${calculateTimeDifference(flight.arrival?.estimated ?? '').minutes}m remaining`
                                    )
                                }
                                </div>
                                <div className='mt-2 text-sm mx-2'>{Math.round(flightInfo.dtoGoNumber)} mi to go</div>
                            </div>
                        </div>
                    </div>
            }
        </div>
    )
}

export default InfoFlight
